import React from "react";
import { Route, Routes } from "react-router-dom";
import ErrorSection from "../../Error/ErrorSection";
import Products from "./Products/Products";
import {
  Container,
  Title,
  Wrapper,
  Menu,
  MenuList,
  MenuItem,
  ItemWrapper,
  ItemTitle,
  ItemSubtitle,
  Main,
} from "./SettingsElements";
import { settingsMenu } from "../../data/data";

const Settings = () => {
  const iconStyle = {
    fontSize: "14px",
    color: "#999",
    margin: "1px 5px 0 0",
  };
  return (
    <Container>
      <Title>Settings</Title>
      <Wrapper>
        <Menu>
          <MenuList>
            {settingsMenu.map((item) => (
              <MenuItem>
                <i style={iconStyle} className="fa-regular fa-heart"></i>
                <ItemWrapper>
                  <ItemTitle>Appereance</ItemTitle>
                  <ItemSubtitle>Dark and Light Mode, Font size</ItemSubtitle>
                </ItemWrapper>
              </MenuItem>
            ))}
          </MenuList>
        </Menu>
        <Main>
          <Routes>
            <Route path="error" element={<ErrorSection />} />
            <Route path="products" element={<Products />} />
          </Routes>
        </Main>
      </Wrapper>
    </Container>
  );
};

export default Settings;
